-- Table: diva_pv_info
CREATE TABLE diva_pv_info
(
    pv_id             INTEGER NOT NULL,
    bpm               INTEGER NOT NULL,
    song_name         VARCHAR(255),
    song_name_eng     VARCHAR(255),
    song_name_reading VARCHAR(255),
    arranger          VARCHAR(255),
    lyrics            VARCHAR(255),
    music             VARCHAR(255),
    performer_number  INTEGER,
    PRIMARY KEY (
                 pv_id
        )
);


-- Table: diva_pv_info_level
CREATE TABLE diva_pv_info_level
(
    id      INTEGER,
    level   VARCHAR(255),
    edition INTEGER NOT NULL,
    version INTEGER NOT NULL,
    diff    VARCHAR(255),
    pv_id   INTEGER,
    PRIMARY KEY (
                 id
        )
);


